x + 6','674'),('02675','noah','math','algebra','Solve the equation: 2(x - 4) = 10','675'),('02676','amir','math','algebra','Simplify the expression: 3(2x + 5) - 2(4x - 3)','676'),('02766','noah','math','hedva','Find the derivative of the function f(x) = 2x^4 + 3x^2 - 5x + 1.','766'),('02767','noah','math','hedva','Find the derivative of the function f(x) = 3sin(x) + 2cos(x).','767'),('02768','noah','math','hedva','Find the derivative of the function f(x) = ln(x^2 + 1).','768'),('02769','noah','math','hedva','Find the derivative of the function f(x) = e^x - x^2.','769'),('02770','noah','math','hedva','Find the derivative of the function f(x) = sqrt(x) + 1/x.','770'),('02771','noah','math','hedva','Find the derivative of the function f(x) = 4x^3 - 6x^2 + 2x - 1.','771'),('02772','noah','math','hedva','Find the derivative of the function f(x) = tan(x) + sec(x).','772'),('02773','noah','math','hedva','Find the derivative of the function f(x) = 5x^2 + 2x - 3.','773'),('02774','noah','math','hedva','Find the derivative of the function f(x) = cos(x^2).','774'),('02775','noah','math','hedva','Find the derivative of the function f(x) = ln(3x + 2).','775');
